import { format } from 'date-fns';
import React from 'react';

const Booking = ({selected}) => {
    return (
        <div className='booking  my-10'>
            <h6 className="title my-3">Available Appointments on {format(selected, 'PP')}</h6>
        </div>
    );
};

export default Booking;
